af0d845e-9c79-4c29-bcb3-8b54ba60c40a	authentik default LDAP Mapping: Name	return ldap.get('name')	goauthentik.io/sources/ldap/default-name
6191d8ae-a1ec-4dc9-8067-26d15511f1b5	authentik default LDAP Mapping: mail	return ldap.get('mail')	goauthentik.io/sources/ldap/default-mail
60e946a4-614c-408a-af45-f79ab4ab3fc3	authentik default Active Directory Mapping: sAMAccountName	return ldap.get('sAMAccountName')	goauthentik.io/sources/ldap/ms-samaccountname
22b1247a-7e9e-4839-be34-7c53f4043afa	authentik default OAuth Mapping: Proxy outpost	# This mapping is used by the authentik proxy. It passes extra user attributes,\n# which are used for example for the HTTP-Basic Authentication mapping.\nsession_id = None\nif "token" in request.context:\n    session_id = request.context.get("token").session_id\nreturn {\n    "sid": session_id,\n    "ak_proxy": {\n        "user_attributes": request.user.group_attributes(request),\n        "is_superuser": request.user.is_superuser,\n    }\n}	goauthentik.io/providers/proxy/scope-proxy
